import React from "react";
import LeftSide from "../../components/LeftSide";

const Messages = () => {
  return (
    <>
      <div className="message-container">
        <div className="message-leftSide">
          <LeftSide />
        </div>
      </div>
    </>
  );
};

export default Messages;
